import { Grid, Input, Paper, TextField, Typography } from "@mui/material";
import React from "react";

const Add = () => {
  return (
    <div>
      
        <Typography textAlign="center" variant="h5" width="100%">Add A New Product</Typography>

        <Paper>
          <Grid container>
            <Grid item >
            <Grid item xs={12}>
                <TextField
                  required
                  fullWidth
                  name="password"
                  label="Password"
                  type="password"
                  id="password"
                  autoComplete="new-password"
                />
              </Grid>

            </Grid>
          </Grid>
        </Paper>
      
    </div>
  );
};

export default Add;
